import React, { Component } from 'react';

class SideWidget extends Component {

    constructor(props) {
        super(props);
        this.state = {
            video: "No video yet",
        };
        this.addView = this.addView.bind(this);
    }

    componentDidMount() {
    }

    addView(e) {
        e.preventDefault();
        console.log("Adding view");
    }

    render() {
        return (
            <div>
                <form>
                    <input type="text" />
                    <button onClick={this.addView} type="submit">Save</button>
                </form>
            </div>
        );
    }
}

export default SideWidget;
